import "../../css/student.css"; // Make sure this path is correct
import "bootstrap/dist/css/bootstrap.min.css";
import DashboardCard from "../compornants/DashboardCard";
import StudentClassCard from "../compornants/StudentClassCard";

const StudentDashboard = () => {
  return (
    <>
      {/* Card Container */}
      <DashboardCard />
      {/* Card Container */}

      <div className="mt-5 rounded-3 col-12">
        <div className="row gap-5 d-flex justify-content-center">
          <div className="ms-4">
            <h2 className="fw-semibold text-bg-primary">Today Classes</h2>
          </div>

          {/* class Card */}
          <StudentClassCard />
          {/* class Card */}
        </div>
      </div>
    </>
  );
};

export default StudentDashboard;
